export const OpponentCard = () => {
	return (
		<>
			<div className={ styles.opponent }>
				<div className={ styles.oppInfoWrapper }>
					<img src={ userImg } alt="puk" />
					<p> Username </p>
				</div>
			</div>
		</>
	)
}
